import React, { useState } from 'react';

function Navbar() {

    const [appletView, setAppletView] = useState("home");

    const setView = (view) => {
        try {
            setAppletView(view);
        } catch (err) {
            console.error('Error toggling the sidebar:', err);
        }
    };

    return(
        
        /* NAVBAR */
        <nav id="navbar" class="navbar sticky-top navbar-expand-lg navbar-dark bg-dark">
            <div class="container-fluid">

                <div class="collapse navbar-collapse" id="navbarNav">
                
                    <ul class="navbar-nav">
                        <li class="nav-item">
                            <a class="nav-link" href="#home" onClick={setView("home")}>Home</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#clients" onClick={setView("clients")}>Clients</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#new-client" onClick={setView("new-client")}>[Add New Client]</a>
                        </li>
                    </ul>

                </div>
                
            </div>
        </nav>
    );

};

export default Navbar;
